// Create a function to generate the header
function createHeader() {
  // Create a header element
  const header = document.createElement('header');

  // Set the innerHTML for the header
  header.innerHTML = `
    <div class="logo-nav-bar-container">
      <img src="../../../images/hera_logo.png" alt="hera logo" class="logo" />
      <nav>
        <ul class="nav-links">
          <li><a href="./index.html">Home</a></li>
          <li><a href="./about-us.html">About Us</a></li>
          <li><a href="./wellness-history.html">Wellness History</a></li>
          <li><a href="./resources.html">Resources</a></li>
        </ul>
      </nav>
      <div class="profile-icon">
        <a href="./profile.html">
          <img src="../../../images/profile_icon.png" alt="Profile" />
        </a>
      </div>
    </div>
  `;

  // Append the header to the body
  document.body.prepend(header);
}

// Call the function to insert the header
createHeader();
